import React from 'react';

const lengthLimit = 7;
let lengthChecker =0;
const Suggestions = (props) => {
    const options  = props.items.map(r =>(
        
        <li key={r.id}>
            {r.name}
        </li>
    ));
    if(lengthLimit >= lengthChecker){
        console.log("suggestions if" + lengthChecker);
        lengthChecker ++;
        
        return <ul>{options}</ul>
    }
    else if ( lengthChecker >= 7){
        console.log("suggestions else if");
        lengthChecker = 0;
        return null;
    }
    else{
        console.log(lengthChecker);
        return null;
    }
}

export default Suggestions
